func StringToBytes(s string) []byte {
	// 移除方括号
	s = strings.Trim(s, "[]")

	// 按空格分割
	parts := strings.Fields(s)

	result := make([]byte, 0, len(parts))
	for _, part := range parts {
		num, err := strconv.Atoi(part)
		if err != nil {
			continue
		}
		result = append(result, byte(num))
	}

	return result
}
